import style from 'styled-components';
import foodImg from '../../assets/image/1.png';

const PostWrap = style.div`
    background-color: #ffffff;
    width: 90vw;
    height: 20vw;
    border-radius: 5vw;
    box-shadow: 0vw 0vw 3vw 0 rgba(0, 0, 0, 0.3);
    margin-bottom: 5vw;
    display: flex;
    flex-direction: row;
`;

const PostImg = style.img`

`;

const PostDetailWrap = style.div`

`;

const PostName = style.div`

`;

const PostDetail = style.div`

`;

const PostSign = style.div`

`;

const PostPrice = style.div`

`;

const PostComponent = ({value}) => {
    return(
        <>
            <PostWrap>
                <PostImg src={foodImg}/>
                <PostDetailWrap>
                    <PostName />
                    <PostDetail />
                    <PostSign />
                </PostDetailWrap>
                <PostPrice />
            </PostWrap>
        </>
    );
}

export default PostComponent;
